function getDialogCount($elem){return Number($elem.getAttribute("data-dialog-count"))||0}function setDialogCount($elem,count){$elem.setAttribute("data-dialog-count",count.toString())}function traverseActiveElements(activeElement=document.activeElement){return null!=activeElement&&null!=activeElement.shadowRoot&&null!=activeElement.shadowRoot.activeElement?traverseActiveElements(activeElement.shadowRoot.activeElement):activeElement}export{getDialogCount,setDialogCount,traverseActiveElements};